import React from 'react'
import {  Link } from "react-router-dom";

function Rightsec() {
    const ColorCng = () => {
        const roundTwo=document.querySelector(".round_2");
        const subMenu=document.querySelector(".subMenu");
        roundTwo.classList.add("active");
        subMenu.appendChild(<li>Career pathway</li>);
    }
    return (
        <>
            <div className="rightsec">
                <div className="rightsec_one">
                    <h1>Step  one </h1>
                    <h2>First page </h2>
                </div>
                <div className="button_box">
                 <div className="btn_all">
                 
                    <Link onClick={ColorCng} to="/career_path" className="second_btn">Continue</Link>
                 </div>
                </div>
            </div>
        </>
    )
}

export default Rightsec
